import CustomDropdown from './CustomDropdown'
import { StyledContent } from './styles/Content.styled'

function ReadySize(props) {
   
    console.log(props)
  return (
    <StyledContent>
        
        <div >   
            <CustomDropdown
              registerName={`${props.registerName}.stitchType`}
              control={props.control}
              
              placeholder={"Seçiniz..."}
              errors={props.errors}
              errorMessage="Marka Seçiniz!"
            />
          </div>

    </StyledContent>
  )
}
export default ReadySize
